import { Fragment } from "react";

const MealsItem = (props)=>{
    return(
        <Fragment>
            <li>
                <div>
                    <h3>{props.name}</h3>
                    <div>{props.description}</div>
                    <div>{props.price}</div>
                </div>
            </li>
        </Fragment>
    )
}

export default MealsItem;
